            easing: 'easeInOutSine',
            duration: 400,
            complete: function(anim){
               playing = false;
            }
          });
    }

    render() {
        const  { name } = this.props
        return (
            <>
            <div onClick={this.handleClick}className="movement-card-container">
                <div className="movement-card">
                    <div className="front">
                     {name}
